// src/models/Professor.js

class Professor {
    constructor(id = null, nome = '', sexo = '', idade = 0, cpf = '') {
        this.id = id;
        this.nome = nome;
        this.sexo = sexo;
        this.matricula = matricula;
        this.idade = idade;
    }
}

export default Professor;
